import React from 'react';

const AboutMe: React.FC = () => {
    return (
        <section id="about-me" className="about-me">
            <h2>About Me</h2>
            <p>
                I am a dedicated and passionate professional with a strong background in [Your Field/Industry]. 
                My expertise includes [list key skills or areas of expertise], and I have a proven track record of 
                [mention any relevant achievements or experiences]. 
                I thrive in dynamic environments and am committed to continuous learning and growth.
            </p>
            <p>
                With a focus on [mention any specific interests or goals related to your profession], 
                I aim to contribute positively to my team and organization. 
                I believe in the power of collaboration and innovation to drive success.
            </p>
        </section>
    );
};

export default AboutMe;
